import React, {Component} from 'react';
import Singerdex from './Singerdex';
import './Singergame.css';

class Singergame extends React.Component {
    static defaultProps = {
        singers : [
            { name: 'Liam Gallagher', band: 'Oasis', exp: 40, intim: 5, img: 'data:image/jpeg;base64,'},
            { name: 'Mick Jagger', band: 'Rollin Stones', exp: 80, intim: 3, img: 'data:image/jpeg;base64,'},
            { name: 'Axl Rose', band: 'Guns N Roses', exp: 48, intim: 5, img: 'data:image/jpeg;base64,'},
            { name: 'Dave Grohl', band: 'Nirvana & Foo Fighters', exp: 51, intim: 4, img: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSgk-bRoH7HryhFboVsQgj45JCRYbnt8MkO3A&usqp=CAU'},
            { name: 'Josh Homme', band: 'Queens of the stone age', exp: 49, intim: 8, img: 'data:image/jpeg;base64,'},
            { name: 'Ozzy Osbourne', band: 'Black Sabbath', exp: 79, intim: 8, img: 'data:image/jpeg;base64,'},
            { name: 'Corey Taylor', band: 'Slipknot & Stone Sour', exp: 82, intim: 9, img: 'data:image/jpeg;base64,'},
            { name: 'James Hetfield', band: 'Metallica', exp: 72, intim: 9, img: 'data:image/jpeg;base64,'},
            { name: 'Serj Tankian', band: 'System of a down', exp: 59, intim: 4, img: 'data:image/jpeg;base64,'},
            { name: 'Jonathan Davies', band: 'Korn', exp: 68, intim: 5, img: 'data:image/jpeg;base64,'},
            { name: 'Tom Araya', band: 'Slayer', exp: 78, intim: 10, img: 'data:image/jpeg;base64,'},
            { name: 'Marilyn Manson', band: 'Solo', exp: 55, intim: 3, img: 'data:image/jpeg;base64,'},
            { name: 'Rob Zombie', band: 'Solo', exp: 49, intim: 5, img: 'data:image/jpeg;base64,'},
            { name: 'Eddie Vedder', band: 'Pearl Jam', exp: 62, intim: 6, img: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSdjZHVfJYvDtIM68WLx7LXTx5wplfw1cxXhQ&usqp=CAU'},
            { name: 'Billie Joe Armstrong', band: 'Green Day', exp: 49, intim: 4, img: 'data:image/jpeg;base64,'},
            { name: 'Anthony Kiedis', band: 'Red Hot Chilli Peppers', exp: 70, intim: 4, img: 'data:image/jpeg;base64,'},
            { name: 'Zack de la Rocha', band: 'Rage Against The Machine', exp: 63, intim: 5, img: 'data:image/jpeg;base64,'},
            { name: 'Roger Daltry', band: 'The Who', exp: 70, intim: 5, img: 'data:image/jpeg;base64,'},
            { name: 'Steven Tyler', band: 'Aerosmith', exp: 67, intim: 4, img: 'data:image/jpeg;base64,'},
            { name: 'Iggy Pop', band: 'Solo', exp: 88, intim: 6, img: 'data:image/jpeg;base64,'},
            { name: 'Robert Plant', band: 'Led Zeplin', exp: 74, intim: 4, img: 'data:image/jpeg;base64,'},
            { name: 'Kelly Jones', band: 'Stereophonics', exp: 45, intim: 5, img: 'data:image/jpeg;base64,'},
            { name: 'Bruce Dickson', band: 'Iron Maiden', exp: 75, intim: 5, img: 'data:image/jpeg;base64,'},
        ]
    };
    render() {
        let hand1 = [];
        let hand2 = [];
        let singersList = [ ...this.props.singers ];
        
        while (hand1.length < 2) {
            let randInd = Math.floor(Math.random() * singersList.length);
            let randSinger = singersList.splice(randInd, 1)[0];
            hand1.push(randSinger);
        }

        while (hand2.length < 2) {
            let randInd2 = Math.floor(Math.random() * singersList.length);
            let randSinger2 = singersList.splice(randInd2, 1)[0];
            hand2.push(randSinger2);
        }

        let exp1 = hand1.reduce((exp, singers) => exp + singers.exp, 0);
        let intim1 = hand1.reduce((intim, singers) => intim + singers.intim, 0);
        let exp2 = hand2.reduce((exp, singers) => exp + singers.exp, 0);
        let intim2 = hand2.reduce((intim, singers) => intim + singers.intim, 0);

        let total1 = exp1 - intim2;
        let total2 = exp2 - intim1;

        return (
          <div className='Singergame'>
              <Singerdex singers={hand1} exp={exp1} intim={intim1} totalScore={total1} isWinner={total1 >= total2} />
              <Singerdex singers={hand2} exp={exp2} intim={intim2} totalScore={total2} isWinner={total2 >= total1} />
          </div>
        );
    }
}

export default Singergame;